import React from "react";
import "./HeroSection.scss";
import { Link } from "react-router-dom";

function Herosection() {
  return (
    <div>
      <div className="hero-container">
        <div className="hero-section-text">
          <div></div>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas vitae enim pharetra, venenatis nunc eget, finibus est. Proin velit </p>
          <button className="btn-primary-medium bg-primary">Sign up</button>
          <p>Do you have account? <Link className="text-primary" to="/login">Log in</Link></p>
        </div>
        <div className="hero-section-image">
          <img src="https://i.ibb.co/VjWm0zC/food.png" alt="food" border="0"></img>
        </div>
      </div>
    </div>
  );
}

export default Herosection;
